'''
给出矩阵 matrix 和目标值 target，返回元素总和等于目标值的非空子矩阵的数量。

子矩阵 x1, y1, x2, y2 是满足 x1 <= x <= x2 且 y1 <= y <= y2 的所有单元 matrix[x][y] 的集合。

如果 (x1, y1, x2, y2) 和 (x1', y1', x2', y2') 两个子矩阵中部分坐标不同（如：x1 != x1'），那么这两个子矩阵也不同。



示例 1：

输入：matrix = [[0,1,0],[1,1,1],[0,1,0]], target = 0
输出：4
解释：四个只含 0 的 1x1 子矩阵。

示例 2：

输入：matrix = [[1,-1],[-1,1]], target = 0
输出：5
解释：两个 1x2 子矩阵，加上两个 2x1 子矩阵，再加上一个 2x2 子矩阵。

示例 3：

输入：matrix = [[904]], target = 0
输出：0

提示：

1 <= matrix.length <= 100
1 <= matrix[0].length <= 100
-1000 <= matrix[i] <= 1000
-10^8 <= target <= 10^8
'''
from typing import List

from leetcode.tools.time import printTime


class Solution:
    '''
    暴力解法
    '''
    @printTime()
    def numSubmatrixSumTarget(self, matrix: List[List[int]], target: int) -> int:
        self.len1 = len(matrix)
        self.len2 = len(matrix[0])
        count = 0
        mem = [[0 for _ in range(self.len2 + 1)] for _ in range(self.len1 + 1)]
        for i in range(self.len1):
            for j in range(self.len2):
                mem[i + 1][j + 1] = mem[i + 1][j] + mem[i][j + 1] - mem[i][j] + matrix[i][j]
                for m in range(0, i + 1):
                    for n in range(0, j + 1):
                        t = mem[i + 1][j + 1] - mem[i + 1][n] - mem[m][j + 1] + mem[m][n]
                        if t == target:
                            count += 1
        return count
    '''
    枚举上下边界，横向使用前缀和
    '''
    @printTime()
    def _1numSubmatrixSumTarget(self, matrix: List[List[int]], target: int) -> int:
        self.len1 = len(matrix)
        self.len2 = len(matrix[0])
        count = 0
        for top in range(self.len1):
            temp = matrix[top]
            for bottom in range(top, self.len1):
                if top != bottom:
                    for right in range(self.len2):
                        temp[right] += matrix[bottom][right]
                sum = 0
                mem = {0: 1}
                for right in range(self.len2):
                    sum += temp[right]
                    if sum - target in mem:
                        count += mem[sum - target]
                    if sum not in mem:
                        mem[sum] = 0
                    mem[sum] += 1
        return count

